import React from "react";
import Slider from "react-slick";
import projectData from '../data/projectData';
import WhiteTypography from './WhiteTypography';
import ProjectCard from './ProjectCard';
import { Box } from "@mui/material";
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Typography from '@mui/material/Typography';
import { CardActionArea } from '@mui/material';

const projectColors = ['#CB6BA8', '#DA8A7F', '#DA8A7F', '#C158C2', '#6D20F2', '#6D20F2', '#b160ec', '#CB6BA8']

export default function ProjectSlider() {
    const settings = {
        className: "center",
        centerMode: true,
        infinite: true,
        centerPadding: "60px",
        slidesToShow: 4,
        speed: 500
    };
    return (
        <div className="container" style={{ marginTop: "5rem" }}>
            <link
                rel="stylesheet"
                type="text/css"
                charset="UTF-8"
                href="https://cdnjs.cloudflare.com/ajax/libs/slick-carousel/1.6.0/slick.min.css"
            />
            <link
                rel="stylesheet"
                type="text/css"
                href="https://cdnjs.cloudflare.com/ajax/libs/slick-carousel/1.6.0/slick-theme.min.css"
            />
            <WhiteTypography variant="h4">Center Mode</WhiteTypography>
            <Slider {...settings} style={{ marginTop: "5rem" }}>
                <div>
                    <Card sx={{ maxWidth: 345 }}>
                        <CardActionArea>
                            <CardMedia
                                component="img"
                                height="140"
                                image="/static/images/cards/contemplative-reptile.jpg"
                                alt="green iguana"
                            />
                            <CardContent>
                                <Typography gutterBottom variant="h5" component="div">
                                    Lizard
                                </Typography>
                                <Typography variant="body2" color="text.secondary">
                                    Lizards are a widespread group of squamate reptiles, with over 6,000
                                    species, ranging across all continents except Antarctica
                                </Typography>
                            </CardContent>
                        </CardActionArea>
                    </Card>
                </div>
                <div>
                    <slide>2</slide>
                </div>
                <div>
                    <slide>3</slide>
                </div>
                <div>
                    <slide>4</slide>
                </div>
                <div>
                    <slide>5</slide>
                </div>
                <div>
                    <slide>6</slide>
                </div>
            </Slider>
        </div>
    );
}

